import Header from "./components/Header";
import Footer from "./components/Footer";

function App() {
  return (
    <div className="bg-[/images/white_00083.jpg]">
      <div className="">
        <Header />
        <h1 className="text-black-800 text-4xl font-bold sm:text-5xl md:mb-12 md:text-6xl text-center">
          WELCOME MY PROFILE PAGE!!!
        </h1>
        <Footer />
      </div>
    </div>
  );
}

export default App;
